INSERT INTO `base_quesion_answer_manager` VALUES ('7a5f3491078b11e6bbb3eca86ba4ba05', '为什么电脑会经常卡死？1', '先看配置的问题，每次卡死都市同一个程序吗？如果是的话请重新下载安装，如果是随机的话看是是否这些软件是否安装在同一个区里，遇到这种情况的话，建议重新安装下系统，如果还遇到这中卡死的情况，用MHDD下扫描下硬盘的环境情况基本是这些问题', '2016-04-21 14:37:06', 'f271b018c1ad11e5a130eca86ba4ba05', '2016-04-25 16:55:18', 'f271b018c1ad11e5a130eca86ba4ba05');
