-- ----------------------------
-- Table structure for `t_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_user`;
CREATE TABLE `t_user` (
  `ID` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '主键ID',
  `USERNAME` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '用户名',
  `PASSWORD` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '密码',
  `NAME` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '姓名',
  `PHONE` varchar(11) COLLATE utf8mb4_bin DEFAULT '' COMMENT '手机号',
  `OPENID` varchar(30) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '微信',
  `ICON` varchar(150) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '头像',
  `USER_TYPE` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '是否需要验证',
  `IS_VALID` tinyint(1) NOT NULL COMMENT '状态',
  `CREATE_PERSON_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `MODIFY_PERSON_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改人',
  `MODIFY_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `REMARK` varchar(1000) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注',
  `ACCREDIT` int(1) NOT NULL DEFAULT '0' COMMENT '授权APP登录 0：未授权   1：已授权',
  `SEX` varchar(11) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '性别',
  `ADDRESS` varchar(1000) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '住址',
  `PET_NAME` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '昵称',
  PRIMARY KEY (`ID`),
  KEY `ID_INDEX` (`ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

-- ----------------------------
-- Records of t_user
-- ----------------------------

-- ----------------------------
-- Table structure for `t_version`
-- ----------------------------
DROP TABLE IF EXISTS `t_version`;
CREATE TABLE `t_version` (
  `ID` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'ID',
  `VERSION` decimal(20,0) NOT NULL COMMENT '版本号',
  `VERSION_NAME` varchar(30) COLLATE utf8mb4_bin NOT NULL COMMENT '版本名称',
  `PLATFORM` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '平台',
  `PACKAGE_PATH` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '安装包路径',
  `UPDRAGE_LOG` varchar(2000) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '升级日志',
  `CREATE_PERSON_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `MODIFY_PERSON_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '修改人',
  `MODIFY_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `REMARK` varchar(1000) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='版本表';

-- ----------------------------
-- Records of t_version
